class Solution {

    /**
     * @param Integer $low
     * @param Integer $high
     * @param Integer $k
     * @return Integer
     */
    function numberOfBeautifulIntegers($low, $high, $k) {
        $count = 0;
        for ($i = $low; $i <= $high; $i++) {
            if ($i % $k === 0 && $this->isEqualEvenOddDigits($i)) {
                $count++;
            }
        }
        return $count;
    }

    private function isEqualEvenOddDigits($num) {
        $evenCount = 0;
        $oddCount = 0;
        while ($num > 0) {
            $digit = $num % 10;
            if ($digit % 2 === 0) {
                $evenCount++;
            } else {
                $oddCount++;
            }
            $num = (int)($num / 10);
        }
        return $evenCount === $oddCount;
    }
}
